import React, { Component } from 'react';
import './Dropdown.css';
const Dropdown=(props)=>{
    return(
        <li className="dropdown">
    <a className="dropbtn">{props.name}</a>
    <div class={p}>
    {props.children}
    </div>
  </li> 
    )
}
export default Dropdown;
